{
  "translationLines": [
    {
      "lineNumber": 1,
      "originalJapaneseLine": "「ほんじゃ、エロ隊長まったねー」",
      "translatedEnglishLine": "\"Well then, see you later, pervy captain!\""
    },
    {
      "lineNumber": 2,
      "originalJapaneseLine": "「くぉら、待たんか！」",
      "translatedEnglishLine": "\"Hey, wait up!\""
    },
    {
      "lineNumber": 3,
      "originalJapaneseLine": "「えー、なによー」",
      "translatedEnglishLine": "\"Ehh, what is it?\""
    },
    {
      "lineNumber": 4,
      "originalJapaneseLine": "ランスはガシッと後ろからメガデスを羽交い締め。",
      "translatedEnglishLine": "Rance grabbed Megadeth from behind with a tight headlock."
    },
    {
      "lineNumber": 5,
      "originalJapaneseLine": "「クリームちゃんに粉かける気だろ。",
      "translatedEnglishLine": "\"You're planning to sprinkle powder on Cream-chan, aren't you?"
    },
    {
      "lineNumber": 6,
      "originalJapaneseLine": "　お前がそんなことしたら、",
      "translatedEnglishLine": "If you do something like that,"
    },
    {
      "lineNumber": 7,
      "originalJapaneseLine": "　俺まで怒られそうだから駄目だ」",
      "translatedEnglishLine": "I might get scolded too, so no way.\""
    },
    {
      "lineNumber": 8,
      "originalJapaneseLine": "「いやー、大丈夫大丈夫、",
      "translatedEnglishLine": "\"No, no, it's fine, it's fine,"
    },
    {
      "lineNumber": 9,
      "originalJapaneseLine": "　ちょろーんて味見するだけ。",
      "translatedEnglishLine": "I'm just going to take a little taste."
    },
    {
      "lineNumber": 10,
      "originalJapaneseLine": "　先っちょだけ、先っちょだけ」",
      "translatedEnglishLine": "Just the tip, just the tip.\""
    },
    {
      "lineNumber": 11,
      "originalJapaneseLine": "「先っちょってどこ！？」",
      "translatedEnglishLine": "\"Where's the tip!?\""
    },
    {
      "lineNumber": 12,
      "originalJapaneseLine": "「ぷはーっ！　美味いー！」",
      "translatedEnglishLine": "\"Phew! Delicious!\""
    },
    {
      "lineNumber": 13,
      "originalJapaneseLine": "「がはははははははは！",
      "translatedEnglishLine": "\"Hahahahahahaha!"
    },
    {
      "lineNumber": 14,
      "originalJapaneseLine": "　やはり、命がけの戦いの後の酒は最高だな！」",
      "translatedEnglishLine": "After all, the drink after a life-or-death battle is the best!\""
    },
    {
      "lineNumber": 15,
      "originalJapaneseLine": "ランスとメガデスの二人が、",
      "translatedEnglishLine": "Rance and Megadeth, the two of them,"
    },
    {
      "lineNumber": 16,
      "originalJapaneseLine": "アタゴの酒場でがっぱーとお酒を飲んでいた。",
      "translatedEnglishLine": "were drinking heartily at Atago's tavern."
    },
    {
      "lineNumber": 17,
      "originalJapaneseLine": "「私達ってー、毎日、戦争戦争で、",
      "translatedEnglishLine": "\"For us, every day is war, war,"
    },
    {
      "lineNumber": 18,
      "originalJapaneseLine": "　神経張り詰めさせてんだから、",
      "translatedEnglishLine": "our nerves are constantly on edge,"
    },
    {
      "lineNumber": 19,
      "originalJapaneseLine": "　たまには緩めないとねー！」",
      "translatedEnglishLine": "we have to relax sometimes!\""
    },
    {
      "lineNumber": 20,
      "originalJapaneseLine": "「うむ、そーゆーことだ！",
      "translatedEnglishLine": "\"Indeed, that's right!"
    },
    {
      "lineNumber": 21,
      "originalJapaneseLine": "　がははは、アタゴちゃんおかわりー！」",
      "translatedEnglishLine": "Hahaha, Atago-chan, another round!\""
    },
    {
      "lineNumber": 22,
      "originalJapaneseLine": "「……はいはい」",
      "translatedEnglishLine": "\"...Yeah, yeah.\""
    },
    {
      "lineNumber": 23,
      "originalJapaneseLine": "「この二人、絶対、",
      "translatedEnglishLine": "\"These two definitely"
    },
    {
      "lineNumber": 24,
      "originalJapaneseLine": "　神経張り詰めた生活はしてない」",
      "translatedEnglishLine": "are not living a life on edge.\""
    },
    {
      "lineNumber": 25,
      "originalJapaneseLine": "「アタゴちゃんも一緒に飲もうよー」",
      "translatedEnglishLine": "\"Atago-chan, come and drink with us too!\""
    },
    {
      "lineNumber": 26,
      "originalJapaneseLine": "「おう、そうだな。",
      "translatedEnglishLine": "\"Oh, yeah."
    },
    {
      "lineNumber": 27,
      "originalJapaneseLine": "　どうせ他に客もいないんだ、座れ座れ」",
      "translatedEnglishLine": "Since there aren't any other customers anyway, have a seat.\""
    },
    {
      "lineNumber": 28,
      "originalJapaneseLine": "「あっ、ちょ、引っ張らないでよ。",
      "translatedEnglishLine": "\"Ah, hey, don't pull me."
    },
    {
      "lineNumber": 29,
      "originalJapaneseLine": "　もう、仕方ないわね……」",
      "translatedEnglishLine": "Geez, you leave me no choice...\""
    },
    {
      "lineNumber": 30,
      "originalJapaneseLine": "「いやー、それにしてもまさか、",
      "translatedEnglishLine": "\"Well, even so, who would've thought"
    },
    {
      "lineNumber": 31,
      "originalJapaneseLine": "　ゴロツキみたいなもんだったエロ隊長が、",
      "translatedEnglishLine": "that the pervy captain who was almost like a thug"
    },
    {
      "lineNumber": 32,
      "originalJapaneseLine": "　今じゃこんな世界の中心人物になるなんてねー」",
      "translatedEnglishLine": "would now become such a central figure in the world.\""
    },
    {
      "lineNumber": 33,
      "originalJapaneseLine": "「戦争、終わったらどうすんの？",
      "translatedEnglishLine": "\"What will you do when the war is over?"
    },
    {
      "lineNumber": 34,
      "originalJapaneseLine": "　王様みたいな感じになるの？」",
      "translatedEnglishLine": "Will you become like a king?\""
    },
    {
      "lineNumber": 35,
      "originalJapaneseLine": "「ふふん、当然、そうなるな。",
      "translatedEnglishLine": "\"Hmph, of course, I will."
    },
    {
      "lineNumber": 36,
      "originalJapaneseLine": "　ただの王じゃないぞ。",
      "translatedEnglishLine": "Not just any king."
    },
    {
      "lineNumber": 37,
      "originalJapaneseLine": "　世界全てを支配する超王様だ」",
      "translatedEnglishLine": "I will be a super king who rules over the entire world.\""
    },
    {
      "lineNumber": 38,
      "originalJapaneseLine": "「おー、いーねー」",
      "translatedEnglishLine": "\"Oh, that's nice.\""
    },
    {
      "lineNumber": 39,
      "originalJapaneseLine": "「そして、また世界中を回るわけだ。",
      "translatedEnglishLine": "\"And then, I'll travel around the world again."
    },
    {
      "lineNumber": 40,
      "originalJapaneseLine": "　俺のまだ知らぬ美女を見つけにな。",
      "translatedEnglishLine": "To find beauties I have yet to know."
    },
    {
      "lineNumber": 41,
      "originalJapaneseLine": "　シィルも連れていってやるか」",
      "translatedEnglishLine": "I might bring Shiru along too.\""
    },
    {
      "lineNumber": 42,
      "originalJapaneseLine": "「がははは、俺様かっこいいー！」",
      "translatedEnglishLine": "\"Hahaha, I'm so cool!\""
    },
    {
      "lineNumber": 43,
      "originalJapaneseLine": "「何言ってんだか……」",
      "translatedEnglishLine": "\"What are you saying...\""
    },
    {
      "lineNumber": 44,
      "originalJapaneseLine": "「むっ」",
      "translatedEnglishLine": "\"Hmph.\""
    },
    {
      "lineNumber": 45,
      "originalJapaneseLine": "「そろそろ結婚でもして",
      "translatedEnglishLine": "\"Maybe it's about time you got married"
    },
    {
      "lineNumber": 46,
      "originalJapaneseLine": "　落ち着いた方がいいんじゃないの？",
      "translatedEnglishLine": "and settled down, don't you think?"
    },
    {
      "lineNumber": 47,
      "originalJapaneseLine": "　シィルちゃんって相手もいるんだしさ」",
      "translatedEnglishLine": "Especially since Shiru-chan has someone, after all.\""
    },
    {
      "lineNumber": 48,
      "originalJapaneseLine": "「なんでそこでシィルが出てくる。",
      "translatedEnglishLine": "\"Why does Shiru come up there?"
    },
    {
      "lineNumber": 49,
      "originalJapaneseLine": "　大体、俺様は生涯現役、",
      "translatedEnglishLine": "Besides, I'll be active for life,"
    },
    {
      "lineNumber": 50,
      "originalJapaneseLine": "　死ぬまで最強の冒険者様だ」",
      "translatedEnglishLine": "the strongest adventurer until I die.\""
    },
    {
      "lineNumber": 51,
      "originalJapaneseLine": "「あーそだねー、",
      "translatedEnglishLine": "\"Ah, that's right."
    },
    {
      "lineNumber": 52,
      "originalJapaneseLine": "　明日死んでも、生涯現役だよねー」",
      "translatedEnglishLine": "Even if you die tomorrow, you're lifelong active, right?\""
    },
    {
      "lineNumber": 53,
      "originalJapaneseLine": "「早死にするの確定でもの抜かすな。",
      "translatedEnglishLine": "\"Don't say stuff like you're definitely going to die young."
    },
    {
      "lineNumber": 54,
      "originalJapaneseLine": "　最強の俺様は100歳まで生きるのだ」",
      "translatedEnglishLine": "The strongest me will live until 100 years old.\""
    },
    {
      "lineNumber": 55,
      "originalJapaneseLine": "「自信家もそこまで行けば本物だー。",
      "translatedEnglishLine": "\"Confidence like that is the real deal."
    },
    {
      "lineNumber": 56,
      "originalJapaneseLine": "　あ、ほら、アタゴちゃん、杯が空いてるよー」",
      "translatedEnglishLine": "Ah, look, Atago-chan, your cup is empty.\""
    },
    {
      "lineNumber": 57,
      "originalJapaneseLine": "「あ、おととと……",
      "translatedEnglishLine": "\"Ah, whoa whoa..."
    },
    {
      "lineNumber": 58,
      "originalJapaneseLine": "　これはどうも」",
      "translatedEnglishLine": "Thank you very much.\""
    },
    {
      "lineNumber": 59,
      "originalJapaneseLine": "「お前こそどうすんだ？",
      "translatedEnglishLine": "\"What about you? What will you do?"
    },
    {
      "lineNumber": 60,
      "originalJapaneseLine": "　やっぱりギルド所属の冒険者に戻るのか？」",
      "translatedEnglishLine": "Are you going back to being an adventurer belonging to the guild after all?\""
    }
  ]
}

